    style='font-size:20.0pt;line-height:107%;color:white;mso-themecolor:background1;
    mso-ansi-language:ES-MX'>La mayoría de las políticas de inmigración son
    federales, pero los gobiernos estatales y locales se están volviendo más
    activos en tratar los temas de inmigración. Recientes iniciativas estatales
    y locales incluyen el establecimiento de ciudades santuario, legislación
    aprobada para disuadir el empleo.<o:p></o:p></span></p>
